// App.js
import React from 'react';
// import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { PaymentForm, EnrollmentForm } from './components'

const Home = () => (
  <div className="min-h-screen flex items-center justify-center">
    <h1 className="text-4xl font-bold text-white">Welcome to Yoga Classes</h1>
  </div>
);

const LandingPage = () => {
  return (
    <div className="min-h-screen flex flex-col md:flex-row bg-gray-900 text-white">
      {/* Left Card */}
      <div className="md:w-1/2 p-8">
        <h1 className="text-4xl font-bold mb-4">An Admission Form for Yoga Classes</h1>
        <img
          className="mb-4 rounded-lg"
          src="https://placekitten.com/400/300" // Replace with your actual image URL
          alt="Yoga Class"
        />
        <p className="text-lg">
          Welcome to our Yoga Classes! Join us to experience the benefits of yoga. Our classes
          cater to all levels, from beginners to advanced practitioners. Connect your mind, body, and
          spirit through the practice of yoga.
        </p>
      </div>

      {/* Right Card with EnrollmentForm */}
      <div className="md:w-1/2 p-8">
        <EnrollmentForm />
      </div>
    </div>
  );
};


const App = () => {
  return (
    <LandingPage />
    // <Router>
    //   <Switch>
    //     <Route path="/" exact component={Home} />
    //     <Route path="/payment" component={PaymentForm} />
    //   </Switch>
    // </Router>
  );
};

export default App;
